import React, { useContext, useState } from 'react';
import PoultryLogo from '../Asset/new_logo.jpg';
import cart_icon from '../Asset/cart_icon.png';
import './Navbar.css';
import { Link } from 'react-router-dom';
import { ShopContext } from '../../context/ShopContext';

function Navbar() {
  const [activemenu, setActiveMenu] = useState("shop");
  const [isMeatDropdownVisible, setMeatDropdownVisible] = useState(false); // State for dropdown visibility
  const { getTotalCartItem } = useContext(ShopContext);

  return (
    <div className="navbar">
      <div className="navbar_logo">
        <img className="logo" src={PoultryLogo} alt="" />
        <p className="logo_name">POULTRY <br /> FARMS</p>
      </div>
      <div className="navbar_menu">
        <li className="catagory_menu" onClick={() => setActiveMenu("shop")}>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>Shop</Link>
          {activemenu === "shop" ? <hr /> : <></>}
        </li>
        <li
          className="catagory_menu"
          onMouseEnter={() => setMeatDropdownVisible(true)} // Show dropdown on hover
          onMouseLeave={() => setMeatDropdownVisible(false)} // Hide dropdown when mouse leaves
        >
          <Link to="/meat" style={{ textDecoration: 'none', color: 'inherit' }}>Meat</Link>
          {activemenu === "meat" ? <hr /> : <></>}
          {isMeatDropdownVisible && (
            <div className="dropdown">
              <div onClick={() => setActiveMenu("liveChicken")}>
                <Link to="/meat/live-chicken" style={{ textDecoration: 'none', color: 'inherit' }}>Live Chicken</Link>
              </div>
              <div onClick={() => setActiveMenu("cookedChicken")}>
                <Link to="/meat/cooked-chicken" style={{ textDecoration: 'none', color: 'inherit' }}>Cooked Chicken</Link>
              </div>
              <div onClick={() => setActiveMenu("uncookedChicken")}>
                <Link to="/meat/uncooked-chicken" style={{ textDecoration: 'none', color: 'inherit' }}>Uncooked Chicken</Link>
              </div>
            </div>
          )}
        </li>
        <li className="catagory_menu" onClick={() => setActiveMenu("eggs")}>
          <Link to="/eggs" style={{ textDecoration: 'none', color: 'inherit' }}>Eggs</Link>
          {activemenu === "eggs" ? <hr /> : <></>}
        </li>
        <li className="catagory_menu" onClick={() => setActiveMenu("tools")}>
          <Link to="/tools" style={{ textDecoration: 'none', color: 'inherit' }}>Tools</Link>
          {activemenu === "tools" ? <hr /> : <></>}
        </li>
      </div>

      <div className="login_cart">
        <Link to="/signup">
          <button
            className={activemenu === 'login' ? "loged login" : "login"}
            onClick={() => setActiveMenu("login")}
          >
            Login
          </button>
        </Link>
        <div
          className={activemenu === 'cart' ? 'carting cartContent' : 'cartContent'}
          onClick={() => setActiveMenu("cart")}
        >
          <Link to="/cart">
            <img className="cartIcon" src={cart_icon} alt="Cart" />
          </Link>
          <div className="cart_count">{getTotalCartItem()}</div>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
